@-moz-document url-prefix("https://www.google.com/calendar"), url-prefix("https://calendar.google.com") {
#gbq1 div a:before, #gbq1 a.gb_Fb:before {        
	    content: "Calendar";
	    text-decoration: none !important;
	    font-size: 2.6em !important;
	    font-family: 'Segoe UI Light', 'Open Sans Light', 'Segoe UI', 'Open Sans' !important;
	    font-weight: 300 !important;
	    color: #fff !important;
	}
    #gb > [class^="gb_"]{
		background: none repeat scroll 0% 0% #4617B4 !important;
	}
    .gbqfb,
	.gbqfb-hvr {
	    border: 1px solid transparent !important;
	    background-image: -moz-linear-gradient(center top, #4617B4, #4617B4) !important;
	    padding: 3px !important;
	}
	a.gbqfb,
	a.gbqfb-hvr {
	    padding: 0px 10px 0px 10px !important;
	    background: #4617B4 !important;
	}
    .qnb-container .goog-imageless-button, .action-btn-wrapper .goog-imageless-button{
        background: none repeat scroll 0% 0% #4617B4 !important;
        border-color: #4617B4 !important;
        color: white;
    }
    .qnb-container .goog-imageless-button:hover{
        background: none repeat scroll 0% 0% #3506A3 !important;
    }
    .applogo #mainlogo{
        color: #4617B4 !important;        
    }
    .goog-imageless-button{
        font-weight: normal !important;
    }
    .tg-nowmarker {
        border-top: 2px solid #3506A3 !important;
    }
    #lo {
        background: #3506A3 !important;
    }
}
